    y[12] = x[12]*16.043030*XWinv; 
    y[13] = x[13]*28.010550*XWinv; 
    y[14] = x[14]*44.009950*XWinv; 
    y[15] = x[15]*29.018520*XWinv; 
    y[16] = x[16]*30.026490*XWinv; 
    y[17] = x[17]*31.034460*XWinv; 
    y[18] = x[18]*26.038240*XWinv; 
    y[19] = x[19]*26.038240*XWinv; 
    y[20] = x[20]*27.046210*XWinv; 
    y[21] = x[21]*28.054180*XWinv; 
